import React, { Component } from 'react'

export class ShowContact extends Component {
  
  render() {
    return (
    <main>
      {this.props.cont.map(el => (
        <div className="menu">
            <div className="blur"/>
            <div className="menu__content">
                <div className="menu__header">Контакты</div>
                <p onShowCont={this.props.onShowCont} key ={el.id} item={el}>{this.props.cont.w}</p>
                <p onShowCont={this.props.onShowCont} key ={el.id} item={el}>{this.props.cont.t}</p>
                <p onShowCont={this.props.onShowCont} key ={el.id} item={el}>{this.props.cont.i}</p>
            </div>
        </div>
      ))}
    </main>
    )    
  }

}


export default ShowContact
